import React from 'react';
import image from '../../assets/bg-masthead.jpg'
import classes from './About.module.css'
const About=()=>{
return(
    
    <React.Fragment>
     <div className={classes.tag3} >
     {image}
     <button className={classes.tag4}>Find Out More</button>
         
     </div>   
   
    </React.Fragment>
)
}



export default About;
